DROP TABLE IF EXISTS tb_admin
CREATE TABLE `tb_admin` (  `tb_id` int(11) NOT NULL AUTO_INCREMENT,  `tb_name` longtext CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,  `tb_pass` longtext CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,  `tb_ip` longtext CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,  `tb_time` longtext CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,  `tb_address` longtext CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,  PRIMARY KEY (`tb_id`),  UNIQUE KEY `tb_id` (`tb_id`)) ENGINE=MyISAM AUTO_INCREMENT=27 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS tb_ht
CREATE TABLE `tb_ht` (  `tb_id` int(11) NOT NULL AUTO_INCREMENT,  `tb_name` longtext CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,  `tb_pass` longtext CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,  PRIMARY KEY (`tb_id`)) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8
